import React from 'react';

const MainScreen = ({ onActivate }) => {
  return (
    <div
      className="bg-image2"
      style={{
        backgroundImage: "url('/bg2.png')",
        minHeight: "100vh",
        width: "100vw",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        textAlign: "center"
      }}
    >
      <img src="/8ball.png" alt="8 Ball" style={{ width: 160, height: 160, marginBottom: 40 }} />
      <button
        style={{
          padding: "12px 32px",
          borderRadius: "24px",
          border: "none",
          background: "rgba(255,255,255,0.08)",
          color: "#fff",
          fontSize: "20px",
          fontFamily: "Jura, Arial, sans-serif",
          cursor: "pointer",
          boxShadow: "0 2px 8px rgba(0,0,0,0.2)"
        }}
        onClick={onActivate}
      >
        Activate
      </button>
    </div>
  );
};

export default MainScreen;
